import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
 import Card from './Components/Card'

const CourseDetail = () => {
  return (
    <View>
      <Text>CourseDetail</Text>
   <Card/>
    </View>
  )
}

const styles = StyleSheet.create({})
export default CourseDetail
